Bir sorun yaşıyorsanız veya yalnızca bot hakkında daha fazla bilgi edinmek istiyorsanız, __Suggester destek sunucusu__na gidin: {{invite}}
Bu mesaj, `{{prefix}}tutorial` komutu ile herhangi bir zamanda gösterilebilir.
